import { StyleSheet, Text, View, TextInput, TouchableOpacity, ScrollView, Alert } from 'react-native';
import AsyncStorage from '@react-native-async-storage/async-storage';
import {useState} from 'react';
import { NavigationContainer } from '@react-navigation/native';
import {createNativeStackNavigator} from '@react-navigation/native-stack';
import { createBottomTabNavigator } from "@react-navigation/bottom-tabs"
import Ionicon from "@expo/vector-icons/Ionicons"
import { AntDesign } from '@expo/vector-icons';
import { FontAwesome5 } from '@expo/vector-icons';
import HomeScreen from './HomeScreen/HomeScreen';
import ProfileScreen from './ProfileScreen/ProfileScreen';
import AboutScreen from './AboutScreen/AboutScreen';
import SupportScreen from './SupportScreen/SupportScreen';


const AlertDialog = (title,message) =>
Alert.alert(title, message, [
  {text: 'OK', onPress: () => console.log('OK Pressed')},
]);

export default function Dashboard(){

    const Tabs = createBottomTabNavigator()

    return(
      <Tabs.Navigator
      screenOptions={({ route }) => ({
        headerShown: false,
        tabBarStyle: {
          paddingHorizontal: 5,
          paddingTop: 0,
          backgroundColor: "#6f70ff",
          position: 'absolute',
          borderTopWidth: 0,
      },
    })}>
        <Tabs.Screen name="Home" component={HomeScreen} options={{title:"Home", headerShown:false, tabBarIcon: (props) => <Ionicon style={styles.home} color={props.focused ? "#FF0000" : "#FFFFFF"}  name = "home-outline" size={25} {...props}/>}}/>
      </Tabs.Navigator>
    )
}
const styles = StyleSheet.create({
    home: {
    },
  });
